import React, { Fragment } from "react";

function Study() {
  return (
    <Fragment>
      <h1>Study: Deck Title</h1>
      <div class="card">
        <div class="card-body">This is some text within a card body.</div>
      </div>
    </Fragment>
  );
}

export default Study;
